import React from 'react';
import Card from './Card';
import Common from './Common';
const Services = () => {
   return (
       <>
          <div className="container-fluid">
          <div className="row">
             <div className="col-10 mx-auto">
             <div className="row">
             <Card/>
             </div>
          </div>
          </div>
          </div>
       </>
   )
}
export default Services;
